import styled from 'styled-components'

const Inner = styled.footer`
    height:24px; 
    width: 1000px;
    margin:auto;

    ul {
        text-align: center;
        padding: 5px;
    }

    li {
        margin: 0px 10px 0px 0px;   
        display: inline;
    }

    a {
        font-size: 50px;
    }
`
export default Inner
